童出郑，美女生燕。”\\n唐·陈子昂《谏雅州讨生羌书》：“﹝秦惠王﹞乃用张仪计，饰美女，谲金牛，因间以啖蜀。”\\n《东周列国志》第二回 ：“赵叔带乃上表谏曰：‘山崩川竭，其象为脂血俱枯，高危下坠，'), ('INSERT INTO `go_quanzi` VALUES (\'3\', \'代购圈\', \'quanzi/20150823/93847035323830.jpg\', \'6\', \'3\', \'3\', null, \'请代购人员迅速到群主的碗里来，我们将不不定期发红包的哦~\', \'代购，通俗一点来说就是找人帮忙购买你需要的商品，原因可以是你在当地买不到这件商品，可以是当地这件商品的价格比其他地区的贵，也可以是为了节省个人时间成本，请人帮忙买好送货上门。帮人从香港，澳门，台湾，甚至美国，日本，法国，韩国购买商品，然后'), ('INSERT INTO `go_quanzi` VALUES (\'4\', \'逻辑思维\', \'quanzi/20150823/96103410340558.jpg\', \'6\', \'2\', \'8\', null, \'逻辑思维线下交流群，欢迎测试使用\', \'由于江青在毛泽东去世前后的一系列恶行已经重重得罪了汪东兴,叶剑英对此也非常...毛主席逝世是一件很不幸的大事,我们都很悲痛,可是还有人不顾大局多方\', \'Y\', \'Y\', \'1440340608\');'), ('INSERT INTO `go_quanzi` VALUES (\'5\', \'帮宝适\', \'quanzi/20150823/44161700340635.jpg\', \'7\', \'1\', \'9\', null, \'天津海河闸岸现大面积死鱼暂无介绍\', \'天津海河闸岸现大面积死鱼 官方回应已赴现场或与大潮有关 2015年8月20日,天津港“8·12”瑞海公司危险品仓库特别重大火灾爆炸事故第11场新闻发布会\', \'Y\', \'Y\', \'1440340663\');'), ('INSERT INTO `go_quanzi` VALUES (\'6\', \'公益群\', \'quanzi/20150823/73545593340684.jpg\', \'4\', \'1\', \'10\', null, \'牙鲤鱼现身美国臭名昭著长相恐怖\', \'牙鲤鱼现身美国臭名昭著长相恐怖 揭如何处理外来物种 2006年6月,这条锯腹脂鲤在亚利桑那州尤玛部落附近被捕获\', \'Y\', \'Y\', \'1440340708\');'), (null), ('-- ----------------------------'), ('-- Table structure for `go_quanzi_hueifu`'), ('-- ----------------------------'), ('DROP TABLE IF EXISTS `go_quanzi_hueifu`;'), ('CREATE TABLE `go_quanzi_hueifu` ('), ('  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT \'ID\','), ('  `tzid` int(11) DEFAULT NULL COMMENT \'帖子ID匹配\','), ('  `hueifu` text COMMENT \'回复内容\','), ('  `hueiyuan` varchar(255) DEFAULT NULL COMMENT \'会员\','), ('  `hftime` int(11) DEFAULT NULL COMMENT \'时间\','), ('  PRIMARY KEY (`id`)'), (') ENGINE=MyISAM AUTO_INCREMENT=40 DEFAULT CHARSET=utf8;'), (null), ('-- ----------------------------'), ('-- Records of go_quanzi_hueifu'), ('-- ----------------------------'), ('INSERT INTO `go_quanzi_hueifu` VALUES (\'1\', \'1\', \'大家不要着急很快就会有活动出来的了！~\', \'1\', \'1440321866\');'), ('INSERT INTO `go_quanzi_hueifu` VALUES (\'2\', \'1\', \'我自己在定下吧~\', \'1\', \